    class Program
    {
        static void Main(string[] args)
        {
			Console.Write("Initializing... ");
            List<Word> WordleDict = init();
			Console.WriteLine("DONE!\n");

            string inStr = "";
			
            do
            {
				//  display the current guess
				Word wrd = new();

				foreach (Word w in WordleDict)
					if(!w.Flagged)
						wrd = w.Score > wrd.Score ? w : wrd;
				
				string g = wrd.Mot;
				//string g = result.ToList<Word>()[0].Mot;

				Console.WriteLine("My Guess: {0}", g);

				//  prompt for the result
				Console.Write("Result? >>>>>[ ");
				inStr = Console.ReadLine();
                
				//  parse the result
                for (int i = 0; i < 5; i++)
                {
                    string L = inStr.Substring(i, 1).ToLower();

                    switch (L)
                    {
                        case "y":
							foreach (Word w in WordleDict)
								if (!w.Flagged)
									if(w.Mot.IndexOf(g.Substring(i, 1)) < 0 || w.Mot.Substring(i, 1) == g.Substring(i, 1))
										w.Flagged = true;
							break;
                        case "x":
							foreach (Word w in WordleDict)
								if(!w.Flagged)
									if(w.Mot.IndexOf(g.Substring(i, 1)) >= 0)
										w.Flagged = true;
							break;
                        case "g":
							foreach (Word w in WordleDict)
								if (!w.Flagged)
									if (w.Mot.Substring(i, 1) != g.Substring(i, 1))
										w.Flagged = true;
							break;
                        default:
                            break;
                    }
                }
				
				Console.WriteLine();
            } while (inStr != "ggggg");
        }

